<script setup>
    import { gsap } from 'gsap';

    function animateIn(element, done) {
        const outline = element.querySelector('.egg-outline');
        const yolk = element.querySelector('.egg-yolk');
        const headingOne = element.querySelector('.heading-one');
        const headingTwo = element.querySelector('.heading-two');

        gsap.timeline({ onComplete: done })
            .fromTo([yolk, outline, headingOne, headingTwo],
            {
                opacity: 0,
                y: 500,
            },
            {
                opacity: 1,
                y: 0,
                duration: 0.5,
                stagger: 0.05,
                ease: 'power2.out',
                onComplete: () => {
                    done();
                    
                    gsap.timeline({ repeat: -1, yoyo: true })
                        .fromTo([yolk, outline], { y: 0 }, { y: -25, duration: 1, ease: 'power1.inOut' });
                },
            });
    }
</script>

